exports=async function(bid,options){const{parseCatalogPaginate,cleanCatalogWrapper}=await require("transcode/parse_catalog"),clientOptions={...(options&&options.clientOptions)};return parseCatalogPaginate(page=>`https://www.qududu.net/book/${bid.idPrefix()}/${bid}${1===page?"":"_"+page}/`,".section-list",{...options,clientOptions,pageSize:50,totalPagesRegex:/option value="\/book\/\d+\/\d+_(?<totalPages>\d+)\/"[^>]*>[^<]+<\/option>\s*<\/select>/})};